import React from 'react';
import picture from '../../images/climb3.jpeg'

import './AboutMe.css';

const AboutMe = ({id}) => {
    return(
            <div className = 'vh-100 center mt5' id = {id}>
                <div className = 'border-height'>
                    <h1 className = 'tc pt5 fw5'>About Me</h1>
                    <div className = 'bb w-50 center'>
                    </div>
                        <div className = 'mt3 mr3 ml3 b--dark-gray '>
                            <div className = 'vh-75 outer flex flex-wrap items-center '>
                                <div className = 'relative o-90 imgWrapper'>
                                    <img src = {picture}
                                         className="br3 ba b--black-10 content pointer dim"
                                         alt = ''/>
                                    <div className = 'text white-90 i hidden grid 1fr 1fr 1fr'>
                                        <h2>Squamish, BC</h2>
                                        <h3>Grand Wall Base Area</h3>
                                        <p>Arrowroot, 5.10b</p>
                                    </div>
                                </div>
                            </div>
                        </div>
                </div>
            </div>
 );
}

export default AboutMe;
